import { v4 as uuidv4 } from "uuid";
export const combos = [
  {
    ten: "Combo Spring",
    expl: "1 bỏng ngô size nhỏ, 1 pepsi",
    gia: "40000",
    quantity: 0,
    id: uuidv4(),
  },
  {
    ten: "Combo Summer",
    expl: "1 bỏng ngô size nhỏ, 2 pepsi",
    gia: "55000",
    quantity: 0,
    id: uuidv4(),
  },
  {
    ten: "Combo Winter",
    expl: "2 bỏng ngô size lớn, 2 pepsi",
    gia: "75000",
    quantity: 0,
    id: uuidv4(),
  },
];
